import React from "react";
import { Button } from "antd";
import { SearchOutlined } from "@ant-design/icons";

export default (props: {
  onClick: (event: React.MouseEvent<HTMLButtonElement, MouseEvent>) => void;
}) => {
  return (
    <>
      <h1>My Pokedex</h1>
      <Button
        type="primary"
        style={{
          height: "40px",
          width: "150px",
          fontSize: "1.3rem",
        }}
        onClick={props.onClick}>
        <SearchOutlined />
        &nbsp; EXPLORE
      </Button>
    </>
  );
};
